import React, { useState, useEffect } from 'react';
import axios from 'axios';

function LoginLogs() {
  const [logs, setLogs] = useState([]);

  useEffect(() => {
    const fetchLogs = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/logs');
        setLogs(response.data);
      } catch (error) {
        console.error('Error fetching logs:', error);
      }
    };
    fetchLogs();
  }, []);

  return (
    <div className="logs-container">
      <h2>Historial de Inicios de Sesi√≥n</h2>
      <table>
        <thead>
          <tr>
            <th>Usuario</th>
            <th>ID</th>
            <th>Fecha y Hora</th>
            <th>Estado</th>
          </tr>
        </thead>
        <tbody>
          {logs.map((log, index) => (
            <tr key={index}>
              <td>{log.user_name}</td>
              <td>{log.user_id}</td>
              <td>{new Date(log.login_time.$date).toLocaleString()}</td>
              <td>{log.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default LoginLogs;
